import React from "react";

const Home = () => {
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-6 mx-auto">
            <h1>
              Grow your buisness with
              <span className="text-primary fw-bold">Satyam</span>
            </h1>
            <h3>We are the team of talented developers making websites</h3>
            <a href="/">
              <button className="btn btn-outline-primary rounded-pill">
                Get Started
              </button>
            </a>
          </div>
          <div className="col-6 mx-auto"></div>
        </div>
      </div>
    </>
  );
};

export default Home;
